description:
Cast: Brittney Skye, Haley Paige, Justine Joli, Nina Hartley, Noname Jane

Charlene loses everything in her life when she leaves her husband, Tony, for a drug dealing boyfriend, Victor. She ends up selling her body to support their habits. When Charlene and Victor decide to rob Tony for more drug money, things go too far, and they kill Tony while Charlenes daughter watches.
